<?php\n// Read data from temporary file\n$data = file('/tmp/search_results.txt');\n\n// Connect to MySQL\n$db = new mysqli('host', 'user', 'password', 'database');\n\n// Insert data in batches\nforeach (array_chunk($data, 100) as $batch) {\n    $stmt = $db->prepare('INSERT INTO search_results (search_id, result_id) VALUES (?, ?)');\n    foreach ($batch as $row) {\n        $stmt->bind_param('ii', $row[0], $row[1]);\n        $stmt->execute();\n    }\n    $stmt->close();\n}\n\n// Clean up\n$db->close();\nunlink('/tmp/search_results.txt');